import React from "react";
import '../style-component/aboutus1.css';
import '../style-component'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


function About1(){

    return(
        <div>
            <div class="box">
                <div class="infobox">

                    <p class="infobox-slimtext">เกี่ยวกับเรา </p>
                    <p class="infobox-boldtext">Buffet EA <span >คือใคร?</span>  </p> <br></br>
                    <p class="infobox-slimtext">Buffet EA เป็นผู้พัฒนาระบบเทรด Forex อัตโนมัติ โดยมีประสบการณ์การเทรดจริงในตลาดมาแล้วมากกว่า 100  ปี เราต้องการสร้าง EA ที่ผู้ใช้สามารถนำไปทดลองปรับเปลี่ยน Parameter และลอง Demo ได้ทุก features โดยไม่ต้องซื้อ
                    เมื่อผู้ใช้มั่นใจแล้ว ต้องการนำไปใช้จริงผู้ใช้จะต้องขอสิทธิในการใช้งานบอท ซึ่งทางผู้จัดทำจะคิดเงินจากการขอใช้สิทธิ</p>

                </div>

            </div>
        </div>

    );
}

export default About1;
